// src/App.js
import React, { useState } from 'react';
import Signup from './components/Signup';
import Login from './components/Login';
import ForgotPassword from './components/ForgotPassword';
import ResetPassword from './components/ResetPassword';
import ProfileUpdate from './components/ProfileUpdate';

const App = () => {
  const [currentForm, setCurrentForm] = useState('signup');

  const handleSignupSuccess = () => {
    setCurrentForm('login');
  };

  const handleLoginSuccess = () => {
    setCurrentForm('profileUpdate');
  };

  const handleForgotPassword = () => {
    setCurrentForm('forgotPassword');
  };

  const handleResetPassword = () => {
    setCurrentForm('resetPassword');
  };

  return (
    <div>
      {currentForm === 'signup' && <Signup onSignupSuccess={handleSignupSuccess} />}
      {currentForm === 'login' && <Login onLoginSuccess={handleLoginSuccess} />}
      {currentForm === 'forgotPassword' && <ForgotPassword />}
      {currentForm === 'resetPassword' && <ResetPassword />}
      {currentForm === 'profileUpdate' && <ProfileUpdate />}
    </div>
  );
};

export default App;
